void
bcm_server_l3_vrrp_config_get(cpudb_key_t r_cpu, uint8 *r_pkt, void *r_cookie)
{
	uint8	*r_pp;
	uint32	r_seq;
	int	r_ret;
	int	r_i;
	int	unit;
	uint32	flags;
	bcm_vlan_t	vlan;
	uint32	alloc_size;
	uint32	count;
	uint32 *	r_p_vrid_array;
	uint32 *	r_p_count;

	r_pp = r_pkt;
	BCM_UNPACK_U32(r_pp, r_seq);
	r_pp = r_pkt + BCM_RPC_HLEN;
	r_ret = BCM_E_NONE;
	BCM_UNPACK_U32(r_pp, unit);
	BCM_UNPACK_U32(r_pp, flags);
	BCM_UNPACK_U16(r_pp, vlan);
	BCM_UNPACK_U32(r_pp, alloc_size);
	if (*r_pp++ == 1) {
		r_p_vrid_array = NULL;
	} else {
		r_p_vrid_array = (void *)1;
	}
	if (*r_pp++ == 1) {
		r_p_count = NULL;
	} else {
		r_p_count = &count;
	}
	if (r_p_vrid_array != NULL) {
		r_p_vrid_array = sal_alloc(alloc_size*sizeof(uint32), "rpc vrid_array");
		if (r_p_vrid_array == NULL) {
			r_ret = BCM_E_MEMORY;
		}
	}
	bcm_rpc_free(r_pkt, r_cookie);

	if (r_ret == BCM_E_NONE) {
		r_ret = bcm_l3_vrrp_config_get(unit, flags, vlan, alloc_size, r_p_vrid_array, r_p_count);
	}

	r_pkt = bcm_rpc_setup('S', (uint32 *)0, 8, r_seq, r_ret);
	r_pp = r_pkt + BCM_RPC_HLEN+4;
	if (r_ret >= 0) {
		if (r_p_vrid_array != NULL) {
			for (r_i = 0; r_i < alloc_size; r_i++) {
				BCM_PACK_U32(r_pp, *(r_p_vrid_array+r_i));
			}
		}
		if (r_p_count != NULL) {
			BCM_PACK_U32(r_pp, *r_p_count);
		}
	}

	if (r_p_vrid_array != NULL) {
		sal_free(r_p_vrid_array);
	}

	bcm_rpc_reply(r_cpu, r_pkt, r_pp-r_pkt);
}

